import React from 'react';

function Images({flex = "",
                    borderRadiusBottom = true,
                    heightBox = "18rem", width = "100%", height = "100%", src}) {
    console.log(src);
    return (
        <div className="image-portfolio" style={{
            height: heightBox,
            flex: flex,
            overflow: "hidden",
            borderRadius: "0px 2px 2px 2px"
        }}>
            <img style={{
                width: width,
                height: height
            }} src={src}>
            </img>
        </div>
    );
}

export default Images;
